import React from 'react'

const Skills = () => {
  return (
    <>
    <div id="Skills" className="container skills">
    <div><h1>SKILLS</h1></div>
    {skills.map((data) => (
            <>
              <div
                className="item"
                key={data.id}
                data-aos="flip-left"
                data-aos-duration="1000"
              >
                <img src={`/assets/${data.imageSrc}`} alt="" />
                <h3>{data.title}</h3>
              </div>
            </>
          ))}
    </div>
  </>
  );
}

export default Skills;
